class MaterialParser{createButton(t){return'<button class="mdl-button mdl-js-button mdl-js-ripple-effect" value="'+t.value+'">'+t.label+"</button>"}createImage(t){return'<img src="'+t.src+'" alt="'+t.alt+'" />'}createCard(t){return'<div class="mdl-grid mdl-cell--'+t.width+'-col"><div class="mdl-card mdl-shadow--2dp"><div class="mdl-card__title"><h3 class="mdl-card__title-text">'+t.title+'</h3></div><div class="mdl-list__item--three-line small-padding  mdl-card--expand"><span class="mdl-list__item-sub-title">'+this.parse(t.body)+"</span></div></div></div>"}createList(t,i){let s=0===t?'<ul class="mdl-list">'+this.parse(i):"";return s+='<li class="mdl-list__item mdl-cell--'+i.width+'-col"><span class="mdl-list__item-primary-content">',i.icon&&(s+='<i class="material-icons mdl-list__item-icon">'+i.icon+"</i>"),s+=i.item+"</span></li>",s+=0===t?"</ul>":""}createText(t){return'<div class="mdl-textfield mdl-js-textfield">'+t.body+"</div>"}createBadge(t){return'<span class="mdl-badge" data-badge="'+t.data+'">'+t.body+"</span>"}createRow(t){return'<div class="mdl-grid mdl-cell--12-col">'+this.parse(t)+"</div>"}createColumn(t){return'<div class="mdl-cell--'+t.width+'-col">'+(t.text?t.text:"")+this.parse(t)+"</div>"}parse(t){let i="";if(t.rows)for(let s in t.rows)i+=this.createRow(t.rows[s]);if(t.columns)for(let s in t.columns)i+=this.createColumn(t.columns[s]);if(t.buttons)for(let s in t.buttons)i+=this.createButton(t.buttons[s]);if(t.images)for(let s in t.images)i+=this.createImage(t.images[s]);if(t.texts)for(let s in t.texts)i+=this.createText(t.texts[s]);if(t.cards)for(let s in t.cards)i+=this.createCard(t.cards[s]);if(t.badges)for(let s in t.badges)i+=this.createBadge(t.badges[s]);if(t.lists)for(let s in t.lists)i+=this.createList(s,t.lists[s]);return i}}let materialize=t=>{return(new MaterialParser).parse(t)};